import React from "react";
import { stack as Menu } from "react-burger-menu";
import { useState } from "react";
import Homepage from "./Homepage";
import Weather from "./Weather";
import YourTour from "./YourTour";

const Hamburger = () => {
	const [page, setPage] = useState(0);
	return (
		<Menu>
			<div id="Weather" className="burgerItem" onClick={() => setPage(2)}>
				Home
			</div>
			<div id="Weather" className="burgerItem" onClick={() => setPage(3)}>
				Weather
			</div>
			<div id="YourTour" className="burgerItem" onClick={() => setPage(4)}>
				Your Tour
			</div>
			<div id="Contact" className="burgerItem" onClick={() => setPage(5)}>
				Contact
			</div>
			{page === 2 && <Homepage />}
			{page === 3 && <Weather />}
			{page === 4 && <YourTour />}
			{page === 5 && <Contact />}
		</Menu>
	);
};

export default Hamburger;
